import { IonButtons, IonContent, IonFab, IonFabButton, IonHeader, IonIcon, IonMenuButton, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import { add } from 'ionicons/icons';
import { title } from 'process';
import { useParams } from 'react-router';
import Card from '../components/Card/Card';
import './Page.css';

const Page: React.FC = () => {

  const { name, title} = useParams<{ name: string, title: "agent" | "complex" | "package" | "promotion"}>();

  const addUrl = "/add/"

  interface Result {
    id: string;
    title: string;
    subtitle: string;
  }

  const result: Result =(
    {
      id:"",
      title:"",
      subtitle:"",
    }
  );

  if (title ==="agent"){

    result.id = "agentId";
    result.title = "Name".concat(" Surname");
    result.subtitle = "Complex Name";

  }else if(title ==="complex"){

    result.id = "complexId";
    result.title = "ComplexName";
    result.subtitle = "Address";

  }else if(title ==="package"){

    result.id = "packageId";
    result.title = "Name";
    result.subtitle = "Price";

  }else{

    result.id = "promotionId";
    result.title = "Name";
    result.subtitle = "Price";

  }

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonMenuButton />
          </IonButtons>
          <IonTitle>{name.concat(" Management")}</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <Card type={title} id={result.id} title={result.title} subtitle={result.subtitle} />
        <IonFab vertical="bottom" horizontal="end" slot="fixed">
          <IonFabButton href={addUrl.concat(title)}>
            <IonIcon icon={add} />
          </IonFabButton>
        </IonFab>
      </IonContent>
    </IonPage>
  );
};

export default Page;
